itemize:
\begin{itemize}
\item Jacobi identities between $f^{abc}$ and $d^{abc}$ are:
\begin{eqnarray*}
&f^{abd}f^{bce}+f^{cba}f^{bde}+f^{dbc}f^{bae}=0\ ,\hspace{1.5cm}
d^{abd}d^{bce}-d^{cba}d^{bde}+f^{dbc}f^{bae}=0\ ,\nonumber\\
&d^{abd}d^{bce}-f^{cba}f^{bde}-d^{dbc}d^{bae}=0\ ,\hspace{1.5cm}
f^{abd}f^{bce}+d^{cba}d^{bde}-d^{dbc}d^{bae}=0\ ,\nonumber\\
&f^{abd}d^{bce}+f^{cba}d^{bde}+f^{dbc}d^{bae}=0\ ,\hspace{1.5cm}
f^{abd}d^{bce}-f^{cba}d^{bde}-d^{dbc}f^{bae}=0\ ,\nonumber\\
&f^{abd}d^{bce}+d^{cba}f^{bde}-f^{dbc}d^{bae}=0\ ,\hspace{1.5cm}
d^{abd}f^{bce}-f^{cba}d^{bde}+f^{dbc}d^{bae}=0\ .\nonumber
\end{eqnarray*}
\item Jacobi identities between $h^{abc}$ and $f^{abc}$ can easily be
obtained by combining above relations:
\begin{eqnarray*}
&h^{abd}f^{bce}+h^{cba}f^{bde}+h^{dbc}f^{bae}=0\ ,\hspace{1.5cm}
f^{abd}h^{bce}+h^{cba}f^{bde}-f^{dbc}h^{bea}=0\ ,\nonumber\\
&f^{abd}h^{bce}-f^{cba}h^{bed}-h^{dcb}f^{bae}=0\ ,\hspace{1.5cm}
h^{abd}f^{bce}-f^{cba}h^{bed}+f^{dbc}h^{bae}=0\ .\nonumber
\end{eqnarray*}
\item Jacobi identities between $h^{abc}$ and $d^{abc}$ can also be obtained in a similar way:
\begin{eqnarray*}
&h^{abd}d^{bce}+ih^{cba}f^{bde}-h^{dbc}d^{bae}=0\ ,\hspace{1.5cm}
if^{abd}h^{bec}+d^{cba}h^{bde}-h^{dbc}d^{bae}=0\ ,\nonumber\\
&h^{abd}d^{bce}-h^{cab}d^{bde}+if^{dbc}h^{bea}=0\ ,\hspace{1.5cm}
h^{abd}d^{bce}+if^{cba}h^{bde}-h^{dcb}d^{bae}=0\ .\nonumber
\end{eqnarray*}
\item Applying the above various Jacobi identities, we can prove
an identity only for $h^{abc}$'s:
\begin{eqnarray*}
h^{abe}h^{bcd}-h^{acb}h^{bde}=0\ .
\end{eqnarray*}
